Przedmiotem zamówienia jest:
1) wykonanie lamperii z tynku mozaikowego;
2) wykonanie ogrodzenia wewnętrznego, wydzielającego istniejący plac zabaw od drogi wewnętrznej i parkingu szkolnego.

